import axios from 'axios'
import React, { useEffect, useState } from 'react'

const Home = () => {
  const [kittens, setKittens] = useState([])

  useEffect(() => {
    axios.get('http://localhost:2023/api/kittens').then((res) => {
      console.log(res.data)
      setKittens(res.data)
    })
  }, [])

  return (
    <div id="page" className=''>
      <div className='flex justify-between p-4 border-b-[1px] border-b-black-50'>
        <div className='font-bold text-2xl'>Kittens</div>
        <div className='flex gap-10 items-center'>
          <a href='#'>Explore</a>
          <a href='#'>My Account</a>
          <a href='#' className='bg-blue-500 text-white font-bold px-4 py-1 rounded-[4px]'>Submit New Kitty</a>
        </div>
      </div>

      <div className='p-4 text-3xl'>
        <h2>{kittens.length} Kittens</h2>
      </div>
    </div>
  )
}

export default Home
